// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

import Home from "./pages/home/Home";
import Login from "./pages/login/Login";
import Profile from "./pages/profile/Profile";
import Register from "./pages/register/Register";
import {BrowserRouter as Router, Route, Routes,} from "react-router-dom";
import React from "react";

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyCOQEqaVF6u130HDbQCIMDYInv7xEMRLow",
  authDomain: "gifty-341101.firebaseapp.com",
  projectId: "gifty-341101",
  storageBucket: "gifty-341101.appspot.com",
  messagingSenderId: "892749485107",
  appId: "1:892749485107:web:f45df6ec206710ba92bf46",
  measurementId: "G-JCQMCG0DW6"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);


function App() {
  return (
      <Router>
        <Routes>
          <Route exact path = "/" element = {<Home />} />
          <Route exact path = "/login" element = {<Login />} />
          <Route exact path = "/register" element = {<Register />} />
          <Route exact path="/profile" element={<Profile />} />
          <Route exact path="/feed" element={<Home />} />
        </Routes>
      </Router>
  )
}

export default App;
